import React from "react";
import ImageCard from "./ImageCard";


const ImageList = ({ images }) => {
 console.log(images);
  const Images = images.map((m, index) => {
    return (
          <ImageCard
              key={m.id}
              images={m}
          />
        );
  });

  return <div className="images-list">{Images}</div>;
};

export default ImageList;
